import "../Style/monitor.css"
import MonitorBack from '../Images/Monitor/Monitor.svg';
import { Parallax } from 'react-scroll-parallax';

function monitorScreen() {
    return (
        <Parallax speed={50}>
            <img id="monitor" src={MonitorBack} alt="monitor" />
        </Parallax>
    );
}

export default monitorScreen;
